function House(){
    const mystyle = {
            color: "#fafafa",
            backgroundColor: "#0D1B2A",
            padding: "3rem"

        };
    return <div style={mystyle}>
        <h1>House</h1>
        <p>Different types of houses</p>
        </div>;
}

export default House;

const styles = StyleSheet.create({
    container: {
      backgroundColor: '#1B263B',
      alignItems: 'center',
